import React from 'react';
import logo from './logo.svg';
import { Button, ButtonGroup, Col, Container, Row } from 'react-bootstrap';
import './App.css';

function App() {
  return (
    <div className="App">
      <Container>
        <Row>
        <ButtonGroup>
          <Button variant="secondary">Dry</Button>
          <Button variant="secondary">Oily</Button>
        </ButtonGroup>
        </Row>
      </Container>
    </div>
  );
}

export default App;
